import React, { Component } from "react";

class Form extends Component {
  state = {};

  render() {
    return (
      <div>
        <h3 align="center">Order</h3>
        <form>
          <label>Name</label>
          <input type="text"></input>
          <label>Address</label>
          <input type="text"></input>
          <label>Email address</label>
          <input type="text"></input>
          <label>Phone number</label>
          <input type="text"></input>
          <label>Choose returning company</label>
          <select>
            <option>Amazon</option>
            <option>eBay</option>
            <option>Other</option>
          </select>
          {/* Insert a text input box when use picked other */}

          <label>Choose pickup time</label>
          <select>
            <option>9:00am - 10:00am</option>
            <option>10:00am - 11:00am</option>
            <option></option>
          </select>

        </form>
      </div>
    );
  }
}

export default Form;
